import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>Welcome to your book list app!</p>
      </header>
      Soon you will be able to track your favorite books, adding comments,
      rewiews and rate!
    </div>
  );
}

export default App;
